import Link from "next/link";
import { useEffect, useState } from "react";
import api from "./../services/axios";

export default function Home() {
  const [repositorios, setRepositorio] = useState([]);

  useEffect(() => {
    async function listarRepositorios() {
      try {
        const { data: repositorios } = await api.get("users/m4t3us89/repos");
        console.log(repositorios);
        setRepositorio(repositorios);
      } catch (err) {
        console.log("Err", err);
      }
    }
    listarRepositorios();
  }, []);

  return (
    <>
      {repositorios.map((repositorio) => {
        <h6 key="{repositorio.id}">{repositorio.name}</h6>;
      })}
    </>
  );
}
